According to the datasheet, STM32F103 MCU can run at the maximum frequency of 72 MHz. But by default it runs at only 8 MHz. To achieve the full potential of the chip, the system frequency should be raised in the run-time. There are three options for the system clock source: HSI (High Speed Internal) - an RC oscillator running at constant 8 MHz and sitting inside the MCU chip. It is the default source for the system clock selected at the start-up. HSE (High Speed External) - an optional external resonator component in the range from 4 to 16 MHz. A Blue Pill board has a 8 MHz crystal connected to the MCU (the component in a metal case right beside the MCU marked as Y2.) PLL (Phase-Locked Loop) - a peripheral inside the MCU that can be used as a multiplier for HSI or HSE. The maximum multiplier for HSI is 8, which can give us 64 MHz, and for HSE - 16, which can theoretically result in 128 MHz, but the output frequency of PLL shouldn't exceed 72 MHz. Given the above, in order to achieve 72 MHz, we should take the following steps: Start the HSE oscillator and wait for it to stabilize. Start the PLL with the HSE input and the multiplier of 9. Wait for it to stabilize. Select the PLL as the source for the system clock. For a start, let's create a module for our project-level constants. Create a new file at src/consts.rs with the following content: //! Project constants. /// HSE crystal frequency.
pub const HSE_FREQ: u32 = 8_000_000; /// PLL multiplication factor.
pub const PLL_MULT: u32 = 9; /// System clock frequency.
pub const SYS_CLK: u32 = HSE_FREQ * PLL_MULT; And register the module in the src/lib.rs: pub mod consts; When the application will need to wait for HSE and PLL clocks stabilization, we don't want it to be constantly checking the flags wasting CPU cycles and energy, but rather to subscribe for an interrupt and sleep until it is triggered. We will use the RCC interrupt for this purpose: Vector Table From the table above, which can be found in the Reference Manual, we only need the position of the RCC interrupt. Let's put this interrupt to the application Vector Table. For this you need to edit thr::vtable! macro in src/thr/mod.rs. By default it looks like this: thr::vtable! { // ... The header is skipped ... // --- Allocated threads --- /// All classes of faults. pub HARD_FAULT;
} There is only a HardFault handler defined. Note that according the above table, HardFault doesn't have a position number, therefore it is referred only by its name. We need to add a new interrupt handler at the position of 5: thr::vtable! { // ... The header is skipped ... // --- Allocated threads --- /// All classes of faults. pub HARD_FAULT; /// RCC global interrupt. pub 5: RCC;
} Since the new handler has a numeric position, the name can be arbitrary. Let's open the trunk thread handler at src/thr/trunk.rs. By default it looks like this: //! The trunk thread. use crate::{thr, thr::Thrs, Regs};
use drone_cortex_m::{reg::prelude::*, thr::prelude::*}; /// The trunk thread handler.
#[inline(never)]
pub fn handler(reg: Regs) { let (thr, _) = thr::init!(reg, Thrs); thr.hard_fault.add_once(|| panic!("Hard Fault")); println!("Hello, world!"); // Enter a sleep state on ISR exit. reg.scb_scr.sleeponexit.set_bit();
} In Drone OS the very first thread with the lowest priority is called a trunk. Its handler is called by the program entry point at src/main.rs, after finishing unsafe initialization routines. The trunk handler receives an instance of Regs, which is a zero-sized type, a set of tokens for all memory-mapped registers. Only one instance of Regs should ever exist. That is why creating one is unsafe and is done inside the unsafe entry point before calling the trunk handler. Inside the trunk handler the reg argument is supposed to be destructured into individual register or register field tokens. To reduce verbosity individual registers are moved from reg in logical groups using macros. These macros should be placed at the beginning of the handler. An example of such macro is thr::init!, which takes an ownership of registers related to threading, such as MPU and NVIC peripherals, and returns an instance of Thrs. Thrs is similar to Regs, but for thread tokens. It is a zero-sized type as well. The first thing the trunk thread actually does (apart from passing ownerships of zero-sized types around) is adding a fiber to the HardFault thread which will panic on trigger. Drone handles panics by writing the panic message to the ITM port #1, issuing a self-reset request, and blocking until it's executed. Let's add a new async function that will be responsible for raising the system clock frequency to 72 MHz. It will need some registers from RCC and FLASH peripherals, as well as an RCC thread token. //! The trunk thread. use crate::{ consts::{PLL_MULT, SYS_CLK}, thr, thr::Thrs, Regs,
};
use drone_core::bmp_uart_baudrate;
use drone_cortex_m::{fib, itm, reg::prelude::*, thr::prelude::*};
use drone_stm32_map::reg; /// The trunk thread handler.
#[inline(never)]
pub fn handler(reg: Regs) { let (thr, _) = thr::init!(reg, Thrs); thr.hard_fault.add_once(|| panic!("Hard Fault")); raise_system_frequency( reg.flash_acr, reg.rcc_cfgr, reg.rcc_cir, reg.rcc_cr, thr.rcc, ) .trunk_wait(); println!("Hello, world!"); // Enter a sleep state on ISR exit. reg.scb_scr.sleeponexit.set_bit();
} async fn raise_system_frequency( flash_acr: reg::flash::Acr<Srt>, rcc_cfgr: reg::rcc::Cfgr<Srt>, rcc_cir: reg::rcc::Cir<Srt>, rcc_cr: reg::rcc::Cr<Srt>, thr_rcc: thr::Rcc,
) { // TODO raise the frequency to 72 MHz
} An async function is a syntax sugar for a function returning a Future. We execute the returned future using the .trunk_wait() method. The trunk_wait method is supposed to be used inside a thread with the lowest priority, i.e. trunk, otherwise the threads that are currently preempted could be stalled. Another option for executing futures is to use exec or add_exec methods on thread tokens. It's good to check that the program still works: $ just flash
$ just itm Let's start filling the raise_system_frequency function. First, we need to enable the RCC interrupt in the NVIC, and allow the RCC peripheral to trigger the interrupt when HSE or PLL is stabilized: thr_rcc.enable_int(); rcc_cir.modify(|r| r.set_hserdyie().set_pllrdyie()); Then we're enabling the HSE clock and waiting until it's stabilized: // We need to move ownership of `hserdyc` and `hserdyf` into the fiber. let reg::rcc::Cir { hserdyc, hserdyf, .. } = rcc_cir; // Attach a listener that will notify us when RCC_CIR_HSERDYF is asserted. let hserdy = thr_rcc.add_future(fib::new_fn(move || { if hserdyf.read_bit() { hserdyc.set_bit(); fib::Complete(()) } else { fib::Yielded(()) } })); // Enable the HSE clock. rcc_cr.modify(|r| r.set_hseon()); // Sleep until RCC_CIR_HSERDYF is asserted. hserdy.await; And similarly enable the PLL: // We need to move ownership of `pllrdyc` and `pllrdyf` into the fiber. let reg::rcc::Cir { pllrdyc, pllrdyf, .. } = rcc_cir; // Attach a listener that will notify us when RCC_CIR_PLLRDYF is asserted. let pllrdy = thr_rcc.add_future(fib::new_fn(move || { if pllrdyf.read_bit() { pllrdyc.set_bit(); fib::Complete(()) } else { fib::Yielded(()) } })); rcc_cfgr.modify(|r| { r.set_pllsrc() // HSE oscillator clock selected as PLL input clock .write_pllmul(PLL_MULT - 2) // output frequency = input clock × PLL_MULT }); // Enable the PLL. rcc_cr.modify(|r| r.set_pllon()); // Sleep until RCC_CIR_PLLRDYF is asserted. pllrdy.await; The flash memory settings should be tweaked for the increased frequency: // Two wait states, if 48 MHz < SYS_CLK <= 72 Mhz. flash_acr.modify(|r| r.write_latency(2)); Before increasing the frequency, we should wait until the currently ongoing ITM transmission is finished if any. And also update the SWO prescaler to maintain the fixed baud-rate defined at the project's Drone.toml. Note that if a debug probe is not connected, this will be a no-op, thus it's safe to keep this in the release binary. itm::flush(); itm::update_prescaler(SYS_CLK, bmp_uart_baudrate!()); And finally switch the source for the system clock to PLL: rcc_cfgr.modify(|r| r.write_sw(0b10)); // PLL selected as system clock Here is the final listing of the raise_system_frequency function: async fn raise_system_frequency( flash_acr: reg::flash::Acr<Srt>, rcc_cfgr: reg::rcc::Cfgr<Srt>, rcc_cir: reg::rcc::Cir<Srt>, rcc_cr: reg::rcc::Cr<Srt>, thr_rcc: thr::Rcc,
) { thr_rcc.enable_int(); rcc_cir.modify(|r| r.set_hserdyie().set_pllrdyie()); // We need to move ownership of `hserdyc` and `hserdyf` into the fiber. let reg::rcc::Cir { hserdyc, hserdyf, .. } = rcc_cir; // Attach a listener that will notify us when RCC_CIR_HSERDYF is asserted. let hserdy = thr_rcc.add_future(fib::new_fn(move || { if hserdyf.read_bit() { hserdyc.set_bit(); fib::Complete(()) } else { fib::Yielded(()) } })); // Enable the HSE clock. rcc_cr.modify(|r| r.set_hseon()); // Sleep until RCC_CIR_HSERDYF is asserted. hserdy.await; // We need to move ownership of `pllrdyc` and `pllrdyf` into the fiber. let reg::rcc::Cir { pllrdyc, pllrdyf, .. } = rcc_cir; // Attach a listener that will notify us when RCC_CIR_PLLRDYF is asserted. let pllrdy = thr_rcc.add_future(fib::new_fn(move || { if pllrdyf.read_bit() { pllrdyc.set_bit(); fib::Complete(()) } else { fib::Yielded(()) } })); rcc_cfgr.modify(|r| { r.set_pllsrc() // HSE oscillator clock selected as PLL input clock .write_pllmul(PLL_MULT - 2) // output frequency = input clock × PLL_MULT }); // Enable the PLL. rcc_cr.modify(|r| r.set_pllon()); // Sleep until RCC_CIR_PLLRDYF is asserted. pllrdy.await; // Two wait states, if 48 MHz < SYS_CLK <= 72 Mhz. flash_acr.modify(|r| r.write_latency(2)); itm::flush(); itm::update_prescaler(SYS_CLK, bmp_uart_baudrate!()); rcc_cfgr.modify(|r| r.write_sw(0b10)); // PLL selected as system clock
}

